import * as React from 'react';
import { Settings, ProductGridView, FoodList } from '../screens';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { fontSizes, colors } from '../constants';
import { View } from 'react-native';

const Tab = createBottomTabNavigator();
const screenOptions = ({ route }: any) => ({
    headerShown: false,
    tabBarInactiveTintColor: colors.primary,
    tabBarActiveBackgroundColor: colors.inactive
})

// const screenOptions = ({ route }: any) => ({
//     headerShown: false,
//     tabBarActiveTintColor: 'white',
//     tabBarInactiveTintColor: colors.inactive,
//     tabBarActiveBackgroundColor: colors.primary,
//     tabBarInactiveBackgroundColor: colors.primary,
// })
function UITab({ route }: any) {
    return (
        <Tab.Navigator initialRouteName={'ProductGridView'} screenOptions={screenOptions}>
            <Tab.Screen
                name={'ProductGridView'}
                component={ProductGridView}
            />
            <Tab.Screen
                name={'FoodList'}
                component={FoodList}
            />
            <Tab.Screen
                name={'Settings'}
                component={Settings}
            />
        </Tab.Navigator>
    )
}

export default UITab;
